func function(n int) []int {
	a := []bool{}
	for i:= 0; i < n; i++ {
		a = append(a, true)
	}
	for i := 2; i*i < n; i++ {
		if a[i] {
			for j := i + i; j < n; j += i {
				a[j] = false
			}
		}
	}
	var result []int
	for i, prime := range a {
		if prime {
			result = append(result, i)
		}
	}
	return result
}

/*
给定一个长度为n的数组，求里面有多少个数字可以拆分成三个大于1的数字相乘，比如说 8=2*2*2，12=2*2*3，求出数组里有多少个这种数字
*/

func function2(a []int)int{
	var result int
	n := len(a)
	fmt.Println(n)
	cnt := make([]int, n)
	for j, v := range a {
		//fmt.Println(v)
		tempflag := make([]bool, v/2 + 1)
		chanflag := 0
		for i := 2; i <= v/2; i++ {
			if tempflag[i] {
				continue
			}
			if v % i != 0 {
				for t := i ; t+i <= v/2; t += i {
					tempflag[t] = true
				}
				continue
			}
			cnt[j]++
			chanflag = 1
			a[j] /= i
			break
		}
		if chanflag == 0 {
			cnt[j] = -1
		}
	}

	for j, v := range a {
		//fmt.Println(v, cnt[j])
		if cnt[j] == -1 {
			continue
		}
		tempflag := make([]bool, v/2 + 1)
		chanflag := 0
		for i := 2; i <= v/2; i++ {
			if tempflag[i] {
				continue
			}
			if v % i != 0 {
				for t := i ; t+i <= v/2; t += i {
					tempflag[t] = true
				}
				continue
			}
			cnt[j]++
			chanflag = 1
			a[j] /= i
			break
		}
		if chanflag == 0 {
			cnt[j] = -1
		}
	}

	for j, v := range a {
		if cnt[j] == -1 {
			continue
		}
		if v > 1 {
			result++
		}
	}

	return result
}

